import React from 'react'
import Cardlist from './Cardlist'
import { cyclists } from './cyclists'

const App = () => {
	return (
		<div>
			<h1 className='tc ttu'>Cycling Greats</h1>
			<Cardlist cyclists={cyclists} />
		</div>
	)
}

export default App
